import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    const Home=() => (
      <div>
        This is the home page
      </div>
    )
    return (
      <Router>
      <div>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/earthquake">Earthquake</Link>
            </li>
            <li>
              <Link to="/volcano">Volcano Eruption</Link>
            </li>
          </ul>

          <hr />

          <Route exact path="/" component={Home} />
          <Route exact path="/speakers" component={ListSpeakers} />
          <Route path="/speakers/new" component={AddSpeaker} />
          <Route path="/speakers/:id/edit" component={EditSpeaker} />
          <Route exact path='/locations' component={ListLocations} />
          <Route path='/locations/new' component={AddLocation} />
          <Route exact path='/locations/:id/edit' component={EditLocation} />
        </div>
      </Router>
    );
  }
}

export default App;
